import React from 'react';

const DifficultyButton = ({type, difficulty, onChoice, label}) => {
    return (
        <div className={`btn btn-${type}`} onClick={onChoice.bind(this, difficulty)}>{label}</div>
    );
}

export default DifficultyButton;
